def solve():
  s = "t236 t166 t319 t369 t119 t96 t328 t235 t107 t359 t71 t183 t74 t379 t236 t195 t108 t272 t370"

  graph = {}
  for char in s:
    if char not in graph:
      graph[char] = []
    graph[char].append(char)

  if is_valid_string(s, graph):
    print("Yes")
  else:
    print("No")

def is_valid_string(s, graph):
  """
  Checks if a string is a valid string generated by a grammar.
  """
  n = len(s)
  if n == 0:
    return True

  if n != len(graph):
    return False

  for char in graph:
    if not isinstance(char, str):
      return False

  return True

